// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import './index.css'; // Import global CSS

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          <h1>GalaxLearn</h1>
          <nav className="nav-buttons">
            <a className="nav-button" href="/home.html">Home</a>
            <a className="nav-button" href="/login.html">Login</a>
            <a className="nav-button" href="/register.html">Register</a>
          </nav>
        </header>

        {/* Using Routes and Navigate for React Router v6 */}
        <Routes>
          <Route path="/" element={<Navigate to="/home.html" replace />} />
          <Route path="/*" element={<div>Please use the navigation to access the correct pages.</div>} />
        </Routes>

        <footer>
          <p>&copy; 2024 GalaxLearn. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
